/**
 * @param {number[]} nums
 * @return {number}
 */
var maxProduct = function (nums) {
    let curMax = 1;
    let curMin = 1;
    let max = nums[0];
    let tmp;

    for (let num of nums){
        tmp = curMax * num;

        curMax = Math.max(tmp, num, curMin * num);
        curMin = Math.min(tmp, num, curMin * num);

        max = Math.max(max, curMax);
    }

    return max;
}

